(24, 72, 'Crestere capsuni', 'crestere-capsuni', '', '<p><span style="font-family: verdana, geneva; font-size: medium;">1.&nbsp;Perioada de vegetatie</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Crestere activa – 30 zile;</span><br /><span style="font-family: verdana, geneva; font-size: medium;">Inflorire, cresterea fructului – 21 zile;</span><br /><span style="font-family: verdana, geneva; font-size: medium;">Coacerea fructului – 9-20 zile (inflorirea, fructificarea si coacerea se repeta de 5-7 ori pe ciclu de&nbsp;cultura)</span><br /><span style="font-family: verdana, geneva; font-size: medium;">Acestea difera in functie de timpul iluminare / zi.</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">', '</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">2. Lumina</span><br /><span style="font-family: verdana, geneva; font-size: medium;">Necesar cultura de capsuni 800-1200 micromoli / m2/ s.</span><br /><span style="font-family: verdana, geneva; font-size: medium;">- Lampi metal halide – 175 w/m2 perioada vegetativa</span><br /><span style="font-family: verdana, geneva; font-size: medium;">- Lampi metal halide – 260 w/m2 perioada de inflorire/coacere</span><br /><span style="font-family: verdana, geneva; font-size: medium;">- Perioada de iluminare: 6-8 ore/zi.</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">3.Temperaturi :</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">In peroada de crestere : 24-25 grade;</span><br /><span style="font-family: verdana, geneva; font-size: medium;">Perioada formare a florilor : 15-18 grade;</span><br /><span style="font-family: verdana, geneva; font-size: medium;">Perioada de coacere a fructelor : 25-26 grade;</span><br /><span style="font-family: verdana, geneva; font-size: medium;">In perioada de coacere pe timpul iernii ( cand se pot inregistra temperaturi mai mici) un bun&nbsp;procedeu de marire a productiei si zaharurilor din fructe este incalzirea solutiei din sistem la 24&nbsp;de grade.</span><br /><span style="font-family: verdana, geneva; font-size: medium;">Temperaturi mai mari de 30 de grade actioneaza ca inhibitor atat la nivel radicular, vegetativ cat&nbsp;si productiv.</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">4. Valori solutie nutritiva:</span></p>\r\n<table>\r\n<tbody>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td><span style="font-family: verdana, geneva; font-size: medium;">Element &nbsp; &nbsp;</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">Perioada vegetativa &nbsp;&nbsp;</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">Perioada de crestere a fructelor &nbsp;&nbsp;</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td><span style="font-family: verdana, geneva; font-size: medium;">Azon (N)</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">160 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">128 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td><span style="font-family: verdana, geneva; font-size: medium;">Fosfor (P)</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">58 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">-</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Potasiu (K)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">136 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">211 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Magneziu (Mg)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">40 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">-</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Calciu (Ca)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">104 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">-</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Sulf (S)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">54 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">-</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Fier (Fe)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">5 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">-</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Mangan (Mn)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">2 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">-</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Zinc (Zn)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">0,25 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">-</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Bor (Br)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">0,7 ppm</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">-</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">5. Ph – 6,0-6,5</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">6. EC – 1200 – 1800 (min-max) 1400 este ideal.</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">7. Bondari : 25 / 250 m2 ( sau la 2000 plante ) - pentru polenizare</span></p>', 1, 0, 0, 16, '2012-11-05 22:34:19', 603, '', '2012-11-05 22:34:45', 603, 0, '0000-00-00 00:00:00', '2012-11-05 22:34:19', '0000-00-00 00:00:00', '', '', '', 2, 0, 1, '', '', 2, 4, '', 0, '*', '');
