(25, 73, 'Crestere salata', 'crestere-salata', '', '<p><span style="font-family: verdana, geneva; font-size: medium;">1.&nbsp;Perioada de vegetatie</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Crestere activa – ?? zile;</span><span style="font-family: verdana, geneva; font-size: medium;"><br /></span></p>\r\n<p>&nbsp;</p>\r\n<hr id="system-readmore" style="width: 992.888916015625px; word-spacing: 0px;" />\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">2. Lumina</span><br /><span style="font-family: verdana, geneva; font-size: medium;">- Necesar cultura de salata 10.000 - 14.000 lucsi.</span><br /><span style="font-family: verdana, geneva; font-size: medium;">- Perioada de iluminare: 12-14 ore/zi.</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">3.Temperaturi :</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">In peroada de crestere : ?? grade;</span></p>\r\n<p><br /><span style="font-family: verdana, geneva; font-size: medium;">4. Valori solutie nutritiva:</span></p>\r\n<table>\r\n<tbody>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td><span style="font-family: verdana, geneva; font-size: medium;">Element &nbsp; &nbsp;</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">Perioada vegetativa &nbsp;&nbsp;</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td><span style="font-family: verdana, geneva; font-size: medium;">Azon (N)</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">160 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td><span style="font-family: verdana, geneva; font-size: medium;">Fosfor (P)</span></td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">58 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Potasiu (K)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">136 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Magneziu (Mg)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">40 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Calciu (Ca)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">135 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Sulf (S)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">54 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Fier (Fe)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">5 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Mangan (Mn)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">2 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Zinc (Zn)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">0,25 ppm</span></td>\r\n</tr>\r\n<tr style="border-color: #000000; border-width: 1px;">\r\n<td>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">Bor (Br)</span></p>\r\n</td>\r\n<td style="text-align: center;"><span style="font-family: verdana, geneva; font-size: medium;">0,7 ppm</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">5. Ph – 5,5-6,0</span></p>\r\n<p><span style="font-family: verdana, geneva; font-size: medium;">6. EC – 1200 – 1800 (min-max) 1400 este ideal.</span></p>', '', 1, 0, 0, 16, '2012-11-05 22:36:22', 603, '', '2012-11-05 22:39:10', 603, 0, '0000-00-00 00:00:00', '2012-11-05 22:36:22', '0000-00-00 00:00:00', '', '', '', 2, 0, 0, '', '', 2, 3, '', 0, '*', ''),
