(10021, 'AllVideos (by JoomlaWorks)', 'plugin', 'jw_allvideos', 'content', 0, 1, 1, 0, '{"legacy":true,"name":"AllVideos (by JoomlaWorks)","type":"plugin","creationDate":"February 8th, 2012","author":"JoomlaWorks","copyright":"Copyright (c) 2006 - 2012 JoomlaWorks Ltd. All rights reserved.","authorEmail":"contact@joomlaworks.net","authorUrl":"www.joomlaworks.net","version":"4.4","description":"JW_PLG_AV_XML_DESC","group":""}', '{"vfolder":"images\\/","vwidth":"400","vheight":"300","transparency":"transparent","background":"#010101","controlBarLocation":"bottom","backgroundQT":"black","afolder":"images\\/audio","awidth":"480","aheight":"24","abackground":"#010101","afrontcolor":"#FFFFFF","alightcolor":"#00ADE3","allowAudioDownloading":"0","autoplay":"0","gzipScripts":"0"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
(10035, 'ImageScaler', 'plugin', 'imagescaler', 'content', 0, 0, 1, 0, '{"legacy":true,"name":"ImageScaler","type":"plugin","creationDate":"July 2011","author":"Markus Bopp - Crosstec Solutions","copyright":"This Joomla! component is released under the GNU\\/GPL license","authorEmail":"markus.bopp@crosstec.de","authorUrl":"www.crosstec.de","version":"1.0","description":"\\n\\t\\n        Resizes images in articles - cropped or letterbox - and caching the resized images.\\n        Opens the original in a modal on click and processes all images in a folder.\\n        <br\\/>\\n        Supported image types: PNG, JPEG and GIF\\n        <br\\/>\\n        <br\\/>\\n        Syntax:\\n        <br\\/><br\\/>\\n        {ImageScaler<br\\/>\\n            &nbsp;width: 100;<br\\/>\\n            &nbsp;height: 100;<br\\/> \\n            &nbsp;file: media\\/sample2.gif;<br\\/> \\n            &nbsp;background-color:  #ffffff;<br\\/> \\n            &nbsp;alt: Alternativ 1;<br\\/> \\n            &nbsp;title: Titel 1;<br\\/> \\n            &nbsp;type: crop;<br\\/>\\n            &nbsp;folder: tmp\\/cache;<br\\/>\\n            &nbsp;cache: 60;<br\\/>\\n            &nbsp;global_cache: 3600;<br\\/>\\n        }<br\\/>\\n        <br\\/>\\n        Minimum:\\n        <br\\/><br\\/>\\n        {ImageScaler<br\\/>\\n            &nbsp;width: 100;<br\\/>\\n            &nbsp;file: media\\/sample2.gif;<br\\/>\\n        }<br\\/>\\n        <br\\/>\\n        Parameters:<br\\/><br\\/>\\n        &nbsp;width: the desired width in pixels, if not given, height is required<br\\/><br\\/>\\n        &nbsp;height: the desired height in pixels, if not given, width is required<br\\/><br\\/>\\n        &nbsp;file: path to the file to be resized. If you enter a path to a folder, all images inside will result in displaying a series of images (does not work with paths beginning with http!). The path can be either relative or absolute. If you are using a http(s) path, make sure allow_url_open is enabled in your php.ini<br\\/><br\\/>\\n        &nbsp;background-color: the background color of the resized file, if type: letterbox is choosen<br\\/><br\\/>\\n        &nbsp;type: add \\"crop\\" or \\"letterbox\\". Crop will try to fit best to the desired dimensions and cut what doesn''t fit while \\"letterbox\\" will fit into the boundaries and provide a frame if necessary.<br\\/><br\\/>\\n        &nbsp;alt: specify an alt message. Default is empty.\\n        &nbsp;title: specify a title for the image. Default is empty.\\n        &nbsp;folder: specify a different target cache folder. Default is media\\/imagescaler\\/cache\\/<br\\/><br\\/>\\n        &nbsp;cache: the cache time in seconds for this image. set to none for no cache. Default is 86400 seconds<br\\/><br\\/>\\n        &nbsp;global_cache: the cache time for all images in the cache folder in seconds. Default is 86400 seconds<br\\/><br\\/>\\n        &nbsp;open: set to \\"true\\" to open the original file or enter a custom url into a modal window (=detail). If the width or height exceed a certain limit, a regular popup will be opened instead of a modal window. on''t use absolute server paths if the \\"file\\" option points to a folder isntead of a single file!<br\\/><br\\/>\\n        &nbsp;align: possible values \\"left\\" and \\"right\\". In a series of images, all images will align inline.\\n        <br\\/>\\n        Notes:\\n        <br\\/><br\\/>\\n        &nbsp;- You may add unlimited numbers of images<br\\/>\\n        <br\\/>\\n        &nbsp;- On errors, the plugin will skip silently. If nothing is displayed, then make sure, that the given file exists, is the right file type and not larger than the Max. Filesize setting in the plugin settings.<br\\/>\\n        <br\\/>\\n        &nbsp;- The cache folder(s) won''t be deleted on plugin uninstall. Don''t forget to delete them manually.<br\\/>\\n        <br\\/>\\n        &nbsp;- Be aware that if you define the tag multiline, having TinyMCE\\/JCE or similiar running, it will translate the tag into html. Turn off the editors or write each tag in one line.<br\\/>\\n        \\n    ","group":""}', '{"max_filesize":"20"}', '', '', 0, '0000-00-00 00:00:00', 0, 0);
